    imageId: string
    isOpen: boolean
}

const ImageDetail: FC<detailProps> = ({ imageId, isOpen }): ReactElement => {

    useEffect(() => {
        fetchImageDetails(imageId).then(
            res => console.log(res)
        )
    }, [])

    return <div className={`${isOpen ? 'absolute' : 'hidden'}`}>

    </div>
}

export default ImageDetail
